import React from "react";
import { Link } from "react-router-dom";
import { Image } from "./Thumb.styles";

const Thumb = ({ image, movieId, clickable }) => {
    return (
        <div>
            {clickable ? (
                <Link>
                    <Image src={image} alt="movie-thumbnail" />
                </Link>
            ) : (
                <Image src={image} alt="movie-thumbnail" />
            )}
        </div>
    );
};

export default Thumb;
